import './Button.css';

function Button({ color, children, onClick }) {
  const style = color === 'red' ? redButtonStyle : blueButtonStyle; // 삼항연산자
  return (
    <button style={style} onClick={onClick}>
      {children}
    </button>
  );
}

export default Button;
